  `sort` int DEFAULT NULL COMMENT '排序',
  `display_set` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '展示设置',
  `display_sort` int DEFAULT NULL COMMENT '展示排序',
  `display_width` int DEFAULT NULL COMMENT '页面展示宽度',
  `enter_set` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '录入设置',
  `enter_sort` int DEFAULT NULL COMMENT '录入排序',
