  `wjbh` varchar(255) DEFAULT NULL COMMENT '文件编号',
  `flh` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '分类号',
  `yz` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '语种',
