  `make_day` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '材料制成时间(日)',
  `remark` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '备注',
